@Override
protected float func(int doc, DocValues[] valsArr) {
  boolean first = true;
  float val = 0.0f;
  for (DocValues vals : valsArr) {
    if (first) {
      first = false;
      val = vals.floatVal(doc);
    } else {
      val = Math.max(vals.floatVal(doc),val);
    }
  }
  return val;
}

